//author: Barbara Li Santi//skeleton supplied to CS 64 in Spring 2019 for the second midterm exampackage for_exam_2;public class DoubleLinkRing2<E> {	private DoubleLinkNode<E> myStart;	public DoubleLinkRing2() {		myStart = new DoubleLinkNode<E>(null);//Picture AAAA	}//constructor	public boolean add (E addMe) {		if (search(addMe) == null) {			DoubleLinkNode<E> temp = new DoubleLinkNode<E>(addMe, myStart, myStart.myPrevious);// Picture BBBB			myStart.myPrevious.myNext = temp;// Picture CCCC			myStart.myPrevious = temp;// Picture DDDD			return true;		} // not a duplicate		return false;	}// add		public DoubleLinkNode<E> search (E findMe) {		DoubleLinkNode<E> aux = myStart.myNext;// Picture EEEE		while ( aux != myStart && !findMe.equals(aux.myData)) {			aux = aux.myNext;// Picture FFFF		} //while		return (aux == myStart ? null : aux );	}// search		public boolean delete(E deleteMe) {		DoubleLinkNode<E> d = search (deleteMe);//Picture GGGG		if ( d == null ) {			return false;		}//if		d.myPrevious.myNext = d.myNext;// Picture HHHH		d.myNext.myPrevious = d.myPrevious;// Picture IIII		return true;	}// delete		public String toString() {		if ( myStart == myStart.myNext) {			return "no data";		}//if		String temp = " ";		DoubleLinkNode<E> aux = myStart.myNext;		while ( aux != myStart ) {			temp += aux.myData + "\n";			aux = aux.myNext;		} // while		return temp;	} // toString}//DoubleLinkRing2